import React, { Component, Fragment } from 'react'
import axios from 'axios'
import Cards from '../components/Cards'
import { Paper, Grid } from '@material-ui/core';

export default class Arriendos extends Component {
    state = {
        prop: [],
        value: 2
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        const { prop } = this.state
        const { value } = this.state
        return (
            <div>
                <Fragment>
                    <Grid item xs={12}>
                        <Paper className='paper_prim'>
                            <h1>Propiedades en Arriendo </h1>
                        </Paper>
                    </Grid>
                    <Grid container spacing={16} justify="center">
                        {prop.map(item => {
                            if (value == item.category) {
                                return (
                                    <Cards
                                        idCard={item.id}
                                        imgBannerCard={item.imgBanner}
                                        tittleCard={item.tittle}
                                        smallContentCard={item.smallContent}
                                    />
                                )
                            }
                        })}

                    </Grid>
                </Fragment>
            </div>
        )
    }
}
